import './RecipesList.css'
import React from "react"

const RecipesList =  (props) => {

    return (
        <div>
            <h2>Listado de rectas</h2>
            {props.recipesList.map((recipe) => {
                <img src={recipe.imageUrl}></img>
            })}

        </div>
    )
}
export default RecipesList
